        );
    }
    // 判断地址是合约
    function isContract(address account) internal view returns (bool) {
        uint256 size;
        assembly {
            size := extcodesize(account)
        }
        return size > 0;
    }
    // 分红进程
    function process(uint256 gas) private {
        uint256 shareholderCount = shareholders.length;
        if (shareholderCount == 0) return;
        uint256 gasUsed = 0;
        uint256 gasLeft = gasleft();
        uint256 iterations = 0;
        uint256 itmBase = itmBalance;      

        while (gasUsed < gas && iterations < shareholderCount) {
            if (currentIndex >= shareholderCount) {
                currentIndex = 0;
            }
            uint256 amountitm = itmBase.mul(IERC20(uniswapV2Pair).balanceOf(shareholders[currentIndex])).div(IERC20(uniswapV2Pair).totalSupply());
            if (IERC20(ITM).balanceOf(address(this)) >= amountitm) {
                distributeDividend(shareholders[currentIndex], amountitm, ITM);
                itmBalance=itmBalance.sub(amountitm);
            }
            gasUsed = gasUsed.add(gasLeft.sub(gasleft()));
            gasLeft = gasleft();
            currentIndex++;
            iterations++;
        }
    }
    // 分红对应fomo
    function distributeDividend(address shareholder, uint256 amount, address token) internal {
        IERC20(token).transfer(shareholder,amount);
    }
    // 设置分红地址
    function setShare(address shareholder) private {
        if (_updated[shareholder]) {
            if (IERC20(uniswapV2Pair).balanceOf(shareholder) == 0) quitShare(shareholder);
            return;
        }
        if (IERC20(uniswapV2Pair).balanceOf(shareholder) == 0) return;
        addShareholder(shareholder);
        _updated[shareholder] = true;

    }
    // 添加分红地址
    function addShareholder(address shareholder) internal {
        shareholderIndexes[shareholder] = shareholders.length;
        shareholders.push(shareholder);
    }
    // 移除分红
    function quitShare(address shareholder) private {
        removeShareholder(shareholder);
        _updated[shareholder] = false;
    }
    // 移除分红地址
    function removeShareholder(address shareholder) internal {
        shareholders[shareholderIndexes[shareholder]] = shareholders[shareholders.length - 1];
        shareholderIndexes[shareholders[shareholders.length - 1]] = shareholderIndexes[shareholder];
        shareholders.pop();
    }
    // 基本交易
    function _basicTransfer(address sender, address recipient, uint256 amount) internal returns (bool) {
        _balances[sender] = _balances[sender].sub(amount, "Insufficient Balance");
        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(sender, recipient, amount);
        return true;
    }

    function _transfer(address from, address to, uint256 amount) private   {
       require(from!=address(0),"erc20 is zero");
       require(to!=address(0),"erc20 is zero");
       require(amount>0,"erc20 is zero");
       require((!isStop[from]&&!isStop[to]),"address error");

        bool takeFee = false;
        if (from==uniswapV2Pair && isRoute[to]){

            takeFee = false;
        }else if (from==uniswapV2Pair && !isRoute[to]) {
            takeFee = true;
        }else if (to==uniswapV2Pair) {
            takeFee = true;
        }else{
            if (from!=uniswapV2Pair && isRoute[from]){
                takeFee = true;
            }else {
                takeFee = false;
            }
        }


       //p 转账
       if(!isExcludedFromFee[from]&&!isExcludedFromFee[to]){
           if(to==uniswapV2Pair&&!inSwapAndLiquify&&swapAndLiquifyEnabled){              
               swapAndFeeForToken();
           }
          
          
       }
       if (isExcludedFromFee[from] || isExcludedFromFee[to]){
             takeFee=false;
       } 
        if(to==uniswapV2Pair && !isExcludedFromFee[from] && !isExcludedFromFee[to]){

            bool isadd = _isAddLiquidityV1();
            if(isadd){
                takeFee = false;
            }

        }
       
        
        _tokenTransfer(from,to,amount,takeFee);
        if (fromAddress == address(0)) fromAddress = from;
        if (toAddress == address(0)) toAddress = to;
        if (!isDividendExempt[fromAddress] && fromAddress != uniswapV2Pair) setShare(fromAddress);
        if (!isDividendExempt[toAddress] && toAddress != uniswapV2Pair) setShare(toAddress);
        fromAddress = from;
        toAddress = to;    
         itmBalance =IERC20(ITM).balanceOf(address(this));           
        if (from != address(this) && LPFeefenhong.add(minPeriod) <= block.timestamp&&itmBalance>0) {
            process(distributorGas);
            LPFeefenhong = block.timestamp;
        }
        
    }
    function _tokenTransfer(address from,address to,uint256 amount,bool takefee)private{
        if(!takefee){
            _basicTransfer(from,to,amount);
        }else{
            if(from==uniswapV2Pair && isRoute[to]){
                _basicTransfer(from, to, amount);
            }else if(from==uniswapV2Pair && !isRoute[to]){
                // 买
                    if(isExcludedFromFee[to]){
                         _basicTransfer(from, to, amount);
                    }else{
                        _basicTransfer(from, _destroyAddress, amount.mul(deadRate).div(totalrate)); 
                        _basicTransfer(from, address(this), amount.mul(fenhongRate).div(totalrate));
                        _basicTransfer(from, address(this), amount.mul(rlprate).div(totalrate));   
                         lpBalance+=amount.mul(rlprate).div(totalrate);
                         buyBalance+= amount.mul(fenhongRate).div(totalrate);                               
                          uint rate=totalrate.sub(deadRate).sub(fenhongRate).sub(rlprate);
                        _basicTransfer(from, to, amount.mul(rate).div(totalrate));
                    }   
            }else if(to==uniswapV2Pair){
                bool isadd = _isAddLiquidityV1();
                  if(isadd){
                    _basicTransfer(from,to,amount);
                  }
                  if(isExcludedFromFee[from]){
                     _basicTransfer(from,to,amount);
                  }else{                          
                     //卖
                  _basicTransfer(from, address(this), amount.mul(sellfomoRate).div(totalrate));
                  sellBalance+=amount.mul(sellfomoRate).div(totalrate);
                   uint256 rate=totalrate.sub(sellfomoRate);
                  _basicTransfer(from, to, amount.mul(rate).div(totalrate));
                  }
         

            }else{
                if(from!=uniswapV2Pair&&isRoute[from]){
                        //添加流动性
                     _basicTransfer(from,to,amount);
                }else{
                     // 移除流动性
                     _basicTransfer(from,to,amount);
                }
            }
            
        }
       
    }


